import React from "react";
import { Link } from "react-router-dom";
import Alert from "./Alert";

const NoteItems = (props) => {
    const ondelete=()=>{
        <Alert message={"Note is Deleted/Removed"}/>
    }
    const onUpdate=()=>{
        <Alert message={"Note is Updated"}/>
    }
  const { note } = props;
  return (
    <div className="col-md-3 my-3">
      <div className="card my-3">
        <div className="card-body">
          <h5 className="card-title">{note.title}</h5>
          <p className="card-text">{note.description}</p>
          {/* <Link to ="#">
          <i className="fa-regular fa-square-plus mx-2"></i>
          </Link => */}
          <Link to ="">
          <i className="fa-regular fa-pen-to-square mx-2" onClick={state.onUpdate}></i>
          </Link>
          <Link to ="">
          <i className="fa-solid fa-trash mx-2" onClick={state.ondelete}></i>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default NoteItems;
